import React, { Component } from 'react';
import { Bar } from 'react-chartjs-2';
import Chart from 'chart.js/auto';
import axios from 'axios';
import Principal from './Principal';
import url from '../Conexions/conexion.js'
import swal from 'sweetalert';
import logo from '../img/logo.png';

class AnalisisSatisfaccion extends Component {

    render() {
        const data = {
            labels: ['ivan', 'nicolas','ivan', 'nicolas','ivan', 'nicolas','ivan', 'nicolas'],
            datasets: [{
                label: 'Materias',
                backgroundColor: 'rgb(0,255,0,1)',
                borderColor: 'black',
                borderWidth: 1,
                hoverBackgroundColor: 'rgb(0,255,0,1)',
                hoverBorderColor: '#FF0000',
                data: [5, 10,5, 10,5, 10,5, 10]
            }]
        };
        const options = {
            maintainAspectRatio: false,
            responsive: true
        }
        return (
            <div className='sb-nav-fixed'>
                <div className='row g-0'>
                    <div id="layoutSidenav_content">
                        <Principal />
                        <div className='margen-top h-100'>
                            <div className='d-flex justify-content-center align-items-center h-100'>
                                <div className=''>
                                    <div className='cardregistro' style={{ borderRadius: '5rem' }}>
                                        <div className=''>
                                            <div className='align-items-center'>
                                                <div className=' p-4 text-black'>
                                                    <section className="centrarelementos form">
                                                        <img className="logo" src={logo} alt="logo"></img>
                                                        <h3 className="text-center mb-4">ANALISIS SATISFACCION</h3>
                                                    </section>

                                                    <form className='centrarelementos'>

                                                        <Bar data={data} options={options}></Bar>
                                                    </form>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>

                    </div>

                </div>
            </div>

        );
    }
}

export default AnalisisSatisfaccion;
